            //Set function for initialize map
			function initialize(){
				//Creating mapProp object for defining map attribute.
				var mapProp = {
					//Set center position of map
					center:new google.maps.LatLng(37.250943,127.028344),
					//zoom level
					zoom:8,
					//화면에 표시될 맵타입을 정의한다. (ROADMAP, SATELLITE, HYBRID...)
					mapTypeId:google.maps.MapTypeId.ROADMAP
				};
				//파라미터 mapProp을 이용하여 설정해준 map을 id가 googlemap인 div태그안에 넣어주는 코드.
				var map = new google.maps.Map(document.getElementById("googleMap"),mapProp);

				for(var i=0; i<200; i++)
				{
                    //Set Marker Location variable
                    var myCenter = new google.maps.LatLng(loc2[i],loc1[i]);
					//MarkerTest
					var marker = new google.maps.Marker({
						position:myCenter,
						/*Encluded from the this code
						animation:google.maps.Animation.BOUNCE*/
						/*MarkerDraggable , but No.
						draggable:true*/
					});
					marker.setMap(map);


					google.maps.event.addListener(marker,'click',function(){
						var infowindow = new google.maps.InfoWindow({content:"Car Accident ",size:new google.maps.Size(200,100)});

						infowindow.open(map,marker);

					})
                }


			}
			//DOM리스너를 추가하여 페이지가 로드될 때 initialize()함수가 실행되게 함.
			google.maps.event.addDomListener(window,'load',initialize);
